USE `ying`;
CREATE 
     OR REPLACE ALGORITHM = UNDEFINED 
    DEFINER = `gxh`@`%` 
    SQL SECURITY DEFINER
VIEW `hs_fund_arbitrage` AS
    SELECT DISTINCT
        `fjjj`.`code` AS `code`,
        `fjjj`.`b` AS `b`,
        `fjjj`.`a` AS `a`,
        `fjjj`.`ratio_BoA` AS `ratio_BoA`,
        ROUND((((1 + `fjjj`.`ratio_BoA`) * `mother`.`jjjz`) - ((`fjjj`.`ratio_BoA` * `b`.`price`) + `a`.`price`)) / ((1 + `fjjj`.`ratio_BoA`) * `mother`.`jjjz`), 
                4) AS `zjl`,
        `mother`.`jjjz` AS `jjjz_mother`,
        `b`.`jjjz` AS `jjjz_b`,
        `b`.`price` AS `price_b`,
        `a`.`jjjz` AS `jjjz_a`,
        `a`.`price` AS `price_a`,
        (CASE
            WHEN
                (ROUND(((((1 + `fjjj`.`ratio_BoA`) * `mother`.`jjjz`) - ((`fjjj`.`ratio_BoA` * `b`.`price`) + `a`.`price`)) / ((`fjjj`.`ratio_BoA` * `b`.`price`) + `a`.`price`)),
                        4) < -(0.02))
            THEN
                '申购母基金，卖出基金A和B'
            WHEN
                (ROUND(((((1 + `fjjj`.`ratio_BoA`) * `mother`.`jjjz`) - ((`fjjj`.`ratio_BoA` * `b`.`price`) + `a`.`price`)) / ((`fjjj`.`ratio_BoA` * `b`.`price`) + `a`.`price`)),
                        4) > 0.02)
            THEN
                '买入基金A和B，赎回母基金'
            ELSE '耐心等待套利机会'
        END) AS `arbitrage_stratage`
    FROM
        (((`hs_fund_mother_son_daughter` `fjjj`
        JOIN `hs_fund_f10_mother` `mother` ON ((`fjjj`.`code` = `mother`.`code`)))
        JOIN `hs_fund_fjjj_list_current` `b` ON ((`fjjj`.`b` = `b`.`code`)))
        JOIN `hs_fund_fjjj_list_current` `a` ON ((`fjjj`.`a` = `a`.`code`)))
    ORDER BY ROUND(((((1 + `fjjj`.`ratio_BoA`) * `mother`.`jjjz`) - ((`fjjj`.`ratio_BoA` * `b`.`price`) + `a`.`price`)) / ((`fjjj`.`ratio_BoA` * `b`.`price`) + `a`.`price`)),
            4);


