CREATE TABLE `hs_fund_fjjj_list` (
  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `code` VARCHAR(18) DEFAULT NULL COMMENT 'code',
  `date` VARCHAR(18) DEFAULT NULL COMMENT 'date',
  `sort_jzzzl` VARCHAR(18) DEFAULT NULL COMMENT 'sort_jzzzl',
  `jjjz` VARCHAR(18) DEFAULT NULL COMMENT 'jjjz',
  `price` VARCHAR(18) DEFAULT NULL COMMENT 'price',
  PRIMARY KEY (`id`),
  UNIQUE KEY `KeyName` (`code`,`date`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8;

DROP PROCEDURE `ying`.`hs_fund_fjjj_list`;
DELIMITER $$
CREATE DEFINER=`gxh`@`%` PROCEDURE `hs_fund_fjjj_list`(IN code VARCHAR(18), date VARCHAR(18), sort_jzzzl VARCHAR(18), jjjz VARCHAR(18), price VARCHAR(18))
BEGIN
SET code = IF(code = '', NULL, code);
SET date = IF(date = '', NULL, date);
SET sort_jzzzl = IF(sort_jzzzl = '', NULL, sort_jzzzl);
SET jjjz = IF(jjjz = '', NULL, jjjz);
SET price = IF(price = '', NULL, price);

INSERT INTO `hs_fund_fjjj_list` (`code`, `date`, `sort_jzzzl`, `jjjz`, `price`) VALUES (code, date, sort_jzzzl, jjjz, price) 
ON DUPLICATE KEY UPDate
`sort_jzzzl` = IF(sort_jzzzl IS NULL, `sort_jzzzl`, sort_jzzzl),
`jjjz` = IF(jjjz IS NULL, `jjjz`, jjjz),
`price` = IF(price IS NULL, `price`, price);
END$$
DELIMITER ;

CALL hs_fund_fjjj_list('[标签:code]','[标签:date]','[标签:sort_jzzzl]','[标签:jjjz]','[标签:price]');

